	"sap/ushell/plugins/rta-personalize/i18n/i18n_no.properties":'#\n#Mon Mar 29 18:19:17 UTC 2021\nMSG_UNSUPPORTED_BROWSER=Du bruker en nettleser som ikke støttes. Bruk Google Chrome eller Microsoft Internet Explorer (versjon 10 eller høyere).\nMSG_STARTUP_WRONG_LAYER=Du kan ikke starte persontilpasning i et annet lag enn “BRUKER”. Fjern parameteren “sap-ui-layer” fra URL-en.\nERROR_TITLE=Feil\nEND_PERSONALIZE_BUTTON_TEXT=Avslutt persontilpasningsmodus\nMSG_STARTUP_FAILED=Persontilpasningsmodusen kan ikke startes\nMSG_STARTUP_NO_OVERLAYS=Dette skjermbildet kan ikke persontilpasses\nTIT_UNSUPPORTED_BROWSER=Nettleser støttes ikke\nSAVE_SUCCESSFUL=Endringene dine er lagret\nHEADER_FLEX_DISABLED=Informasjon\nPERSONALIZE_BUTTON_TEXT=Persontilpass app\nAPP_TITLE=Persontilpass FLP-plug-in\nMSG_FLEX_DISABLED=Denne applikasjonen er ikke aktivert for persontilpasning. Du finner mer informasjon [her](https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
	"sap/ushell/plugins/rta-personalize/i18n/i18n_pl.properties":'#\n#Mon Mar 29 18:19:17 UTC 2021\nMSG_UNSUPPORTED_BROWSER=Używana przeglądarka nie jest obsługiwana. Proszę użyć przeglądarki Google Chrome lub Microsoft Internet Explorer (w wersji 10 lub nowszej).\nMSG_STARTUP_WRONG_LAYER=Personalizacji nie można uruchomić w warstwie innej niż “USER”. Proszę usunąć parametr “sap-ui-layer” z URL.\nERROR_TITLE=Błąd\nEND_PERSONALIZE_BUTTON_TEXT=Opuść tryb personalizacji\nMSG_STARTUP_FAILED=Nie można uruchomić trybu personalizacji.\nMSG_STARTUP_NO_OVERLAYS=Personalizacja tego ekranu nie jest możliwa.\nTIT_UNSUPPORTED_BROWSER=Przeglądarka nie jest obsługiwana\nSAVE_SUCCESSFUL=Twoje zmiany zostały zapisane.\nHEADER_FLEX_DISABLED=Informacja\nPERSONALIZE_BUTTON_TEXT=Personalizacja aplikacji\nAPP_TITLE=Personalizacja pluginu FLP\nMSG_FLEX_DISABLED=Ta aplikacja nie została aktywowana dla dostosowania. Aby uzyskać szczegółowe informacje, sprawdź [tutaj](https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
	"sap/ushell/plugins/rta-personalize/i18n/i18n_pt.properties":'#\n#Mon Mar 29 18:19:17 UTC 2021\nMSG_UNSUPPORTED_BROWSER=Você está utilizando um browser não suportado. Utilize Google Chrome ou Microsoft Internet Explorer (versão 10 ou superior).\nMSG_STARTUP_WRONG_LAYER=Impossível começar a personalização em uma camada diferente de “USER”. Remover parâmetro “sap-ui-layer” do URL.\nERROR_TITLE=Erro\nEND_PERSONALIZE_BUTTON_TEXT=Encerrar modo de personalização\nMSG_STARTUP_FAILED=O modo de personalização não pode ser iniciado.\nMSG_STARTUP_NO_OVERLAYS=Esta tela não é personalizável.\nTIT_UNSUPPORTED_BROWSER=O browser não é suportado\nSAVE_SUCCESSFUL=As suas modificações foram gravadas.\nHEADER_FLEX_DISABLED=Informação\nPERSONALIZE_BUTTON_TEXT=Personalizar app\nAPP_TITLE=Personalizar plug-in FLP\nMSG_FLEX_DISABLED=Esta aplicação não está ativada para personalização. Para mais informações, consulte [aqui](https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
	"sap/ushell/plugins/rta-personalize/i18n/i18n_pt_PT.properties":'#\n#Mon Mar 29 18:19:17 UTC 2021\nMSG_UNSUPPORTED_BROWSER=Lamentamos, mas o seu browser não é suportado. Utilize o Google Chrome ou Microsoft Internet Explorer (versão 10 ou superior).\nMSG_STARTUP_WRONG_LAYER=Não pode iniciar a personalização em uma camada que não seja “USER”. Remova o parâmetro “sap-ui-layer” do URL.\nERROR_TITLE=Erro\nEND_PERSONALIZE_BUTTON_TEXT=Sair do modo de personalização\nMSG_STARTUP_FAILED=Lamentamos, mas não foi possível iniciar o modo de personalização.\nMSG_STARTUP_NO_OVERLAYS=Lamentamos, mas este ecrã não pode ser personalizado.\nTIT_UNSUPPORTED_BROWSER=Browser não suportado\nSAVE_SUCCESSFUL=As suas alterações foram guardadas.\nHEADER_FLEX_DISABLED=Informações\nPERSONALIZE_BUTTON_TEXT=Personalizar a aplicação\nAPP_TITLE=Personalizar plug-in de FLP\nMSG_FLEX_DISABLED=Esta aplicação não está ativada para a personalização. Para mais informações, consulte [aqui](https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
